function table.contains(table,element) for _,value in pairs(table) do if value==element then return true end end return false end
local function isInside(x1, y1, xs, ys, xe, ye)
    return xs <= x1 and x1 <= xe and ys <= y1 and y1 <= ye
end
local function doesClip(x1,y1,x2,y2)
    return isInside(x1, y1, x2, y2, x2+8, y2+8) or isInside(x1 + 8, y1, x2, y2, x2+8, y2+8) or isInside(x1, y1+8, x2, y2, x2+8, y2+8) or isInside(x1+8, y1+8, x2, y2, x2+8, y2+8)
end

local pi = math.atan(1)*4
local _clear_tiles = { 0, 4 }
local function distance(fx, fy, tx, ty) return math.sqrt((tx-fx)^2 + (ty-fy)^2) end
local function canSee(p1, p2)
    local tx, ty = p1.x, p2.y
	local fx, fy = p1.x, p2.y
	if fx == tx and fy == ty then
		return true
	end
	-- Find 8 tiles around
	local closest8 = {}
	table.insert(closest8, {x=fx   ,y=fy+1})
	table.insert(closest8, {x=fx   ,y=fy-1})
	table.insert(closest8, {x=fx-1 ,y=fy  })
	table.insert(closest8, {x=fx-1 ,y=fy+1})
	table.insert(closest8, {x=fx-1 ,y=fy-1})
	table.insert(closest8, {x=fx+1 ,y=fy+1})
	table.insert(closest8, {x=fx+1 ,y=fy-1})
	table.insert(closest8, {x=fx+1 ,y=fy  })
	for i = 1,#closest8 do
		local cll = closest8[i]
		if closest8[i].x == tx and closest8[i].y == ty then return true end
	end
	-- Find the closest one
	local dstMin = math.huge
	local closest = {}
	for i = 1,#closest8 do
		local x = closest8[i].x
		local y = closest8[i].y
		if distance(x, y, tx, ty) < dstMin then
			closest = closest8[i]
			dstMin = distance(x, y, tx, ty)
		end
	end
	-- check if it's obstructed
	local n = mget(closest.x, closest.y)
    if table.contains(_clear_tiles, n) then
        return canSee(closest, posTo)
    else
        return false
    end
end

-- for random seeding
local function stringToNum(s)
    local total = 1
    for i = 1, s:len() do
        local si = s:sub(i, i)
        total = total * string.byte(si)
    end
    return total
end

