local function addBullet(x, y, ai, dmg, v, sprite)
    local bullet = { x = x, y = y, ai = ai, dmg = dmg, sp = sprite }
    function bullet:tick()
        if self.ai == "homing" then
            -- calc angle between self and player
            local dx = state.player.x - self.x
            local dy = state.player.y - self.y
            local d = distance(state.player.x, state.player.y, self.x, self.y)
            local vv = {
                x = dx / (d+1),
                y = dy / (d+1)
            }
            self.x = self.x + vv.x
            self.y = self.y + vv.y
        elseif self.ai == "bullet" then
            self.x = self.x + v.x
            self.y = self.y + v.y
        end
        if self.ai ~= "dead" then
            for x = 0, 29 do
                for y = 0, 16 do
                    if (not table.contains(_clear_tiles, mget(x, y))) and doesClip(x*8, y*8, self.x, self.y) then
                        self.ai = "dead"
                    end
                end
            end
            if doesClip(self.x, self.y, state.player.x, state.player.y) then
                state.player.hp = state.player.hp - self.dmg
                self.ai = "dead"
            end
            spr(self.sp, self.x, self.y, 0)
        end
    end
    table.insert(Bullets, bullet)
end

local function mkBoss(bid, lvl)
    local template = Bosses[bid]
    if template.btype == "turret" then
        template.dmg = 1
        template.hp = lvl * 5
        template.turnrate = (120 / lvl) // 1
        function template:attack()
            local dir = 4
            if (state.player.x - self.x) > 0 then dir = 3 elseif (state.player.x - self.x) < 0 then dir = 1 else dir = 2 end
            if (state.player.y - self.y) > 0 then dir = dir + 6 elseif (state.player.y - self.y) < 0 then dir = dir else dir = dir + 3 end
            addBullet(self.x, self.y, "homing", self.dmg, {x=1,y=1,dir=dir}, self.bsprite)
        end
        function template:doTurn()
            self:attack()
        end
    elseif template.btype == "jumper" then
        template.turnrate = 120
        template.state = "idle"
        template.hp = lvl*10
        template.dmg = 2*lvl
        template.hasDamaged = false
        function template:attack()
            self.state = "jumping"
            -- if doesClip(state.player.x, state.player.y, self.x, self.y) and not self.hasDamaged then
        end
    elseif template.btype == "pong" then
        template.dmg = 1
        template.hp = lvl*3 + 4
        template.turnrate = 1
        template.v = {
            x = 2 + math.random(-1, 0)*4,
            y = 2 + math.random(-1, 0)*4
        }
        template.hasDamaged = false
        function template:attack()
            if doesClip(state.player.x, state.player.y, self.x, self.y) and not self.hasDamaged then
                state.player.hp = state.player.hp - self.dmg
                self.hasDamaged = true
            end
        end
        function template:doTurn()
            self.x = self.v.x + self.x
            self.y = self.v.y + self.y
            if self.x > 240-16 then self.v.x = -self.v.x  self.x = 240-16  self.hasDamaged = false end
            if self.x < 0 then self.v.x = -self.v.x  self.x = 0  self.hasDamaged = false end
            if self.y > 136-16 then self.v.y = -self.v.y  self.y = 136-16  self.hasDamaged = false end
            if self.y < 0 then self.v.y = -self.v.y  self.y = 0  self.hasDamaged = false end
            self:attack()
        end
    end
    return template
end

local function onLevelStart()
    state.level = state.level + 1
    Bullets = {}
    state.boss = mkBoss(math.random(1, #Bosses), state.level)
    state.player.x = 120 - 4
    state.player.y = 100
end
local function onLevelEnd()
    state.player.cash = state.player.cash + state.level * math.random(4, 20)
    state.mode = Modes.shop
end

