local function drawHealth()
	rectb(5, 4, state.player.mhp*5 + 2, 10, 12)
	rect(6, 5, state.player.hp*5, 8, 6)
	print(state.player.hp .. '/' .. state.player.mhp, 28, 7, 12)
	spr(117, 0, 0, 0, 1, 0, 0, 2, 2) 
end

local function handlePlayerInput()
    local dx = 0
    local dy = 0
    if btn(0) then dy = dy - 1 end
    if btn(1) then dy = dy + 1 end
    if btn(2) then dx = dx - 1 end
    if btn(3) then dx = dx + 1 end
    state.player.x = state.player.x + dx * state.player.speed
    state.player.y = state.player.y + dy * state.player.speed
    if state.player.x >= 240-8 then state.player.x = 240-9 end
    if state.player.x <= 0 then state.player.x = 1 end
    if state.player.y >= 136-8 then state.player.y = 136-9 end
    if state.player.y <= 0 then state.player.y = 1 end
    if doesClip(state.player.x, state.player.y, state.boss.x, state.boss.y) or doesClip(state.player.x, state.player.y, state.boss.x, state.boss.y+8) or doesClip(state.player.x, state.player.y, state.boss.x+8, state.boss.y) or doesClip(state.player.x, state.player.y, state.boss.x+8, state.boss.y+8) then
        state.player.x = state.player.x - dx * state.player.speed
        state.player.y = state.player.y - dy * state.player.speed
    end
    for ix = 0, 29 do
        for iy = 0, 16 do
            if not table.contains(_clear_tiles, mget(ix, iy)) then
                if doesClip(state.player.x, state.player.y, ix*8, iy*8) then
                    state.player.x = state.player.x - dx * state.player.speed
                    state.player.y = state.player.y - dy * state.player.speed
                end
            end
        end
    end
    if dy == -1 then state.player.direction = 0
        elseif dy == 1 then state.player.direction = 2
        elseif dx == -1 then state.player.direction = 3
        elseif dx == 1 then state.player.direction = 1
    end
    if btnp(5) then state.player:hit() end
end
local function isBossThere(x, y)
    return doesClip(x, y, state.boss.x, state.boss.y) or doesClip(x, y, state.boss.x+8, state.boss.y) or doesClip(x, y, state.boss.x, state.boss.y+8) or doesClip(x, y, state.boss.x+8, state.boss.y+8)
end
function state.player:hit()
    local dir = self.direction
    local tcx, tcy = self.x, self.y
    local slashDuration = 3 -- ticks = 0.25(s)
    local slashSprite = 9
    if dir == 0 then
        tcx, tcy = self.x, self.y-8
        PARTICLES:add(slashSprite, tcx, tcy, 0, 0, slashDuration)
    elseif dir == 1 then
        tcx, tcy = self.x+8, self.y+8
        PARTICLES:add(slashSprite, tcx, tcy-8, 1, 0, slashDuration)
    elseif dir == 2 then
        tcx, tcy = self.x, self.y + 16
        PARTICLES:add(slashSprite, tcx, tcy-8, 2, 0, slashDuration)
    elseif dir == 3 then
        tcx, tcy = self.x-8, self.y+8
        PARTICLES:add(slashSprite, tcx, tcy-8, 1, 1, slashDuration)
    end
    if isBossThere(tcx, tcy) then state.boss.hp = state.boss.hp - state.player.dmg end
end
local function drawPlayer() spr(state.player.sprite, state.player.x, state.player.y, 14, 1, 0, 0) end

function TIC()
    cls(0)
    if state.mode == Modes.mainMenu then
        MENU:loop()
    elseif state.mode == Modes.nameEntry then
        NAME:loop(function(name)
            math.randomseed(stringToNum(name))
            state.mode = Modes.tutorial
        end)
    elseif state.mode == Modes.tutorial then
        print("Press Z to skip", 10, 100)
        print("Arrow keys to move", 10, 85)
        print("X to attack", 10, 75)
        if btnp(4) then state.mode = Modes.game  onLevelStart() end
    elseif state.mode == Modes.game then
        map()
        handlePlayerInput()
        for i, bullet in pairs(Bullets) do
            bullet:tick()
        end
        if state.boss.hp <= 0 then onLevelEnd() end
        if t % state.boss.turnrate == 0 then
            state.boss:doTurn()
        end
        local nw = print(state.boss.name, -80000, -80000)
        print(state.boss.name, (240-nw)//2, 6, 2)
        print('level: ' .. state.level, 240-70, 6, 12)
        drawPlayer()
        -- drawBoss()
        spr(state.boss.sprite, state.boss.x, state.boss.y, 0, 1, 0, 0, state.boss.size, state.boss.size)
        if state.player.hp <= 0 then state.mode = Modes.gameOver end
        PARTICLES:loop(t - lastT)
        drawHealth()
    elseif state.mode == Modes.shop then
        local mx, my, ml, mrest = mouse()
        if not ml then lastMl = false end
        if mousel and not ml then
            lastMl = true
        end
        mousel = ml
        GUI:loop(mx, my, lastMl)
        print("stats:", 10, 30, 12)
        line(80, 30, 80, 100, 12)
        print("items:", 85, 30, 12)
        line(10, 40, 220, 40, 12)
        if btnp(4) then state.mode = Modes.game  onLevelStart() end
        print('money: ' .. state.player.cash, 240-50 - tostring(state.player.cash):len() * 7, 10, 12)
        local w = print('z to exit, left click to buy', 240000, 240000)
        print('z to exit, left click to buy', (240-w)//2, 110, 12)
        drawHealth()
    elseif state.mode == Modes.gameOver then
        local w = print('Game Over', -800000, -800000)
        print("Game Over", (240-w)//2, (136-8)//2, 2)
        if got % 60 == 0 then
            reset()
        end
        got = got + 1
    end
    lastT = t
    t = t + 1
end
